import { Dehaze, KeyboardArrowDown, Search } from '@mui/icons-material';
import React from 'react';
import styled from 'styled-components';

const Container = styled.div`
  display: flex;
  background-color: white;
  padding: 15px 20px;
`;
const Left = styled.div`
  flex: 1;
  display: flex;
  align-items: center;
  justify-content: center;
`;
const Logo = styled.h1`
  font-size: 25px;
  font-weight: 800;
`;
const Center = styled.div`
  flex: 2;
  display: flex;
  align-items: center;
  justify-content: center;
`;
const SearchContainer = styled.div``;
const Input = styled.div``;
const Button = styled.button``;
const Right = styled.div`
  flex: 1;
`;
const MenuItem = styled.div``;
const Navbar = () => {
  return (
    <Container>
      <Left>
        <Logo>BOOKSTORE</Logo>
      </Left>
      <Center>
        <Dehaze />
        <KeyboardArrowDown />
        <SearchContainer>
          <Input />
          <Button>
            <Search />
          </Button>
        </SearchContainer>
      </Center>
      <Right></Right>
    </Container>
  );
};

export default Navbar;
